# Performs sliding window technique

def findAnagrams(string: str, anagram: str):
    anagram = ''.join(sorted(anagram))
    current_string = ''
    result = []
    window_start = 0

    for char in string:

        # slide the right side of the window (equivalent to adding the next character to current string)
        current_string += char

        #start checking the window once the window size is size of anagram
        if len(current_string) == len(anagram):

            # sort the current string and check if it equals the anagram
            if ''.join(sorted(current_string)) == anagram:
                result.append(window_start)

            # remove the leftmost character and slide the left side of the window
            current_string = current_string[1:]
            window_start += 1

    return result




if __name__ == "__main__":
    s = ""
    p = ""
    print(findAnagrams(s, p))
